import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import axios from 'axios';
import Header from '../components/Header';

const StudentDetailPage = () => {
  const { id } = useParams();
  const [student, setStudent] = useState(null);
  const formatDate = (dateStr) => dateStr?.split('T')[0];

  useEffect(() => {
    axios.get(`http://localhost:5000/api/student/${id}`)
      .then(res => setStudent(res.data))
      .catch(err => console.error('❌ ดึงข้อมูลนิสิตผิดพลาด:', err));
  }, [id]);

  if (!student) {
    return (
      <div className="min-h-screen bg-gray-100 p-6">
        <Header />
        <p>กำลังโหลดข้อมูล...</p>
      </div>
    );
  }

  return (
    <div className="min-h-screen bg-gradient-to-br from-purple-500 to-indigo-700 text-white font-sans">
      <Header />
      <div className="mt-6 p-6 max-w-3xl mx-auto bg-white text-black rounded-lg shadow">
        <h2 className="text-2xl font-bold mb-4 text-purple-700">👤 รายละเอียดนิสิต</h2>
        <ul className="space-y-2">
          <li><strong>รหัสนิสิต:</strong> {student.student_id}</li>
          <li><strong>ชื่อ:</strong> {student.student_name}</li>
          <li><strong>อีเมล:</strong> {student.email}</li>
          <li><strong>เบอร์โทร:</strong> {student.phone_number}</li>
          <li><strong>สาขา:</strong> {student.major}</li>
          <li><strong>คณะ:</strong> {student.faculty}</li>
          <li><strong>มหาวิทยาลัย:</strong> {student.university}</li>
          <li><strong>เพศ:</strong> {student.gender}</li>
          <li><strong>ชั้นปี:</strong> {student.year_level}</li>
          <li><strong>GPA:</strong> {student.gpa}</li>
          <li><strong>วันเกิด:</strong> {formatDate(student.birth_date)}</li>
          <li><strong>อายุ:</strong> {student.age}</li>
          <li><strong>ทักษะพิเศษ:</strong> {student.special_skills}</li>
          <li><strong>วันที่เริ่มฝึกงาน:</strong> {formatDate(student.intern_start_date)}</li>
          <li><strong>วันที่สิ้นสุดฝึกงาน:</strong> {formatDate(student.intern_end_date)}</li>
          <li><strong>รูปโปรไฟล์:</strong> <br />
            {student.profile_image && (
              <img src={`http://localhost:5000/uploads/${student.profile_image}`} alt="Profile" className="square-profile rounded w-32 h-32 object-cover mt-2" />
            )}
          </li>
        </ul>
      </div>
    </div>
  );
};

export default StudentDetailPage;
